import React from 'react'
import { Link } from 'react-router-dom';
import image from './'
import styles from './Landing.module.css'

const LandingPage = () => {
    
    return (
        <div className={styles.landingWrapper}>
        <p>Let's Go!</p>
        <Link className={styles.landingButton} to="/home">
          <button>Home</button>
        </Link>
      </div>
    );

};

export default LandingPage;
